function isEmpty(value) {
    if (value) {
        return false;
    }
    return true;
}

function iif(condition, valueTrue, valueFalse) {
    if (condition) {
        return valueTrue;
    }
    return valueFalse;
}

function ifs(...args) {
    for (let i = 0; i < args.length; i += 2) {
        const expressionResult = args[i];
        if (expressionResult) {
            if (i + 1 < args.length) {
                return args[i + 1];
            }
            return null;
        }
    }
    return null;
}

function dateTimeNow() {
  var now = new Date();
  var nowUTC = new Date(Date.UTC(
    now.getFullYear(), 
    now.getMonth(), 
    now.getDate(), 
    now.getHours(), 
    now.getMinutes(), 
    now.getSeconds(), 
    now.getMilliseconds()
));
    return nowUTC;
}

function dateDifference(startDate, endDate, kind) {
    const diffInMilliseconds = endDate.getTime() - startDate.getTime();
    switch (kind) {
        case 'year':
            return endDate.getFullYear() - startDate.getFullYear();
        case 'month':
            return (endDate.getFullYear() - startDate.getFullYear())
                * 12 + (endDate.getMonth() - startDate.getMonth());
        case 'quarter':
            // eslint-disable-next-line no-case-declarations
            const startQuarter = Math.floor(startDate.getMonth() / 3);
            // eslint-disable-next-line no-case-declarations
            const endQuarter = Math.floor(endDate.getMonth() / 3);
            return (endDate.getFullYear() - startDate.getFullYear()) * 4 + (endQuarter - startQuarter);
        case 'day':
            return Math.floor(diffInMilliseconds / (1000 * 60 * 60 * 24));
        default:
            throw new Error('dateDifference. Invalid interval kind.');
    }
}

Date.prototype.beginDay = function beginDay() {
    return new Date(Date.UTC(this.getFullYear(), this.getMonth(), this.getDate()));
};
Date.prototype.endDay = function endDay() {
    return new Date(Date.UTC(this.getFullYear(), this.getMonth(), this.getDate(), 23, 59, 59, 999));
};
Date.prototype.addDays = function addDays(days) {
    const result = new Date(this);
    result.setDate(result.getDate() + days);
    return result;
};
Date.prototype.beginMonth = function beginMonth() {
    return new Date(Date.UTC(this.getFullYear(), this.getMonth(), 1));
};
Date.prototype.endMonth = function endMonth() {
    return (new Date(Date.UTC(this.getFullYear(), this.getMonth() + 1, 0))).endDay();
};
Date.prototype.addMonths = function addMonths(months) {
    const result = new Date(this);
    result.setMonth(result.getMonth() + months);
    return result;
};
Date.prototype.beginQuarter = function beginQuarter() {
    let month;
    switch (this.getMonth()) {
        case 0:
        case 1:
        case 2:
            month = 0;
            break;
        case 3:
        case 4:
        case 5:
            month = 3;
            break;
        case 6:
        case 7:
        case 8:
            month = 6;
            break;
        case 9:
        case 10:
        case 11:
            month = 9;
            break;
        default:
            month = 0;
    }
    return new Date(Date.UTC(this.getFullYear(), month, 1, 0, 0, 0));
};
Date.prototype.endQuarter = function endQuarter() {
    let month;
    switch (this.getMonth()) {
        case 0:
        case 1:
        case 2:
            month = 2;
            break;
        case 3:
        case 4:
        case 5:
            month = 5;
            break;
        case 6:
        case 7:
        case 8:
            month = 8;
            break;
        case 9:
        case 10:
        case 11:
            month = 11;
            break;
        default:
            month = 2;
    }
    return (new Date(Date.UTC(this.getFullYear(), month, 1))).endMonth();
};
Date.prototype.addQuarters = function addQuarters(quarters) {
    const result = new Date(this);
    return result.addMonths(quarters * 3);
};
Date.prototype.beginYear = function beginYear() {
    return new Date(this.getFullYear(), 0, 1);
};
Date.prototype.endYear = function endYear() {
    return new Date(Date.UTC(this.getFullYear(), 11, 31, 23, 59, 59, 999));
};
Date.prototype.addYears = function addYears(years) {
    const result = (new Date(this));
    result.setFullYear(result.getFullYear() + years);
    return result;
};
